import React from "react";
import Header from "../../components/header/Header.js";
import Footer from "../../components/footer/Footer.js";
import "./Registration.css"

class Registration extends React.Component {
    state = {
        name: "",
        last_name: "",
        login: "",
        nickname: "",
        email: "",
        phone: "",
        password1: "",
        password2: ""
    }

    

    onTextChange = event => {
        switch (event.target.id ){
            case "input_name": 
                this.setState({name: event.target.value});
                break;
            case "input_last_name": 
                this.setState({name: event.target.value});
                break;
            case "input_login": 
                this.setState({name: event.target.value});
                break;
            case "input_nickname": 
                this.setState({name: event.target.value});
                break;
            case "input_mail": 
                this.setState({name: event.target.value});
                break;
            case "input_phone": 
                this.setState({name: event.target.value});
                break;
            case "input_pass1": 
                this.setState({name: event.target.value});
                if (length(this.state.password1) < 8)
                break;
            case "input_pass2": 
                this.setState({name: event.target.value});
                if (this.state.password1 != this.state.password2) {
                    event.target.style.backgroundColor = "#ff5349";
                } else {
                    event.target.style.backgroundColor = "#76ff7a";
                }
                break;
        }
    }

    render() {
        return (
            <div>
                <Header isMain={false} />
                <div className="reg_wrap">
                    <div className="reg_block">
                        <div className="reg_title">
                            <h style={{marginBottom: "10px"}}>Форма регистрации</h>
                        </div>
                        <table className="inputs">
                            <tr className="inputs_row">
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} maxLength="30" id="input_name" type="text" placeholder="Имя"></input>
                                </td>
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} maxLength="40" id="input_last_name" type="text" placeholder="Фамилия"></input>
                                </td>
                            </tr>
                            <tr className="inputs_row">
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} maxLength="30" id="input_login" required type="text" placeholder="Логин"></input>
                                </td>
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} maxLength="20" id="input_nickname" type="text" placeholder="Никнейм"></input>
                                </td>
                            </tr>
                            <tr className="inputs_row">
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} required maxLength="50" id="input_mail" type="text" placeholder="Почта"></input>
                                </td>
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} type="text" id="input_phone" placeholder="Телефон"></input>
                                </td>
                            </tr>
                            <tr className="inputs_row">
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} required minLength="8" id="input_pass1" maxLength="70" type="text" placeholder="Пароль"></input>
                                </td>
                                <td className="inputs_col">
                                    <input onChange={this.onTextChange} required minLength="8" id="input_pass2" maxLength="70" type="text" placeholder="Подтверждение пароля"></input>
                                </td>
                            </tr>
                        </table>
                    </div>
                </div>
                <Footer style={{background: "#FFFDC7", height: "380px"}}/>
            </div>
        )
    }
}
export default Registration;
